import React from "react";
import Product from "../Components/product/Product";
import Slider from "../Components/common/Slider";
import OwlCarousel from "../Components/common/OwlCarouselSection";

function HomePage() {
  return (
    <>
      <Slider />
      <Product />
      <OwlCarousel />
    </>
  );
}

export default HomePage;
